dts:
declare module 'fast-glob' {
  import Transform from 'stream';
  export function sync(patterns: string[], options?: any): string[];
  export default Transform;
}

declare module 'plugin-error' {
  export default class PluginError extends Error {
    constructor(message: string, options?: any);
  }
}

declare module 'purgecss' {
  export class PurgeCSS {
    constructor(options?: any);
    purge(css: string): string;
  }
}

declare module 'stream' {
  export interface Transform {
    transform(chunk: any, encoding: string, callback: (error?: Error | null, data?: any) => void): void;
  }
}

declare module 'through2' {
  export function obj(): Transform;
}

declare module 'vinyl' {
  export interface Vinyl {
    path: string;
    contents: Buffer;
  }
}

declare module 'vinyl-sourcemaps-apply' {
  export default function applySourcemaps(vinylFile: Vinyl): void;
}
